import { Component } from 'react'
import './index.css'

const viewConstent = {
    sedOtpView: 'SENDOTPVIEW',
    verifyOtpView: 'VERIFYOTPVIEW',
    loadingView: 'LOADING',
    successView: 'SUCCESS',
}

class CreateAccount extends Component {
    render() {
        return (
            <div className='create-account-bg'>
                <form className='create-account-form' onSubmit={this.createAccount}>
                    
                </form>
            </div>
        )
    }
}

export default CreateAccount
